import * as React from "react";
import { createStackNavigator } from "@react-navigation/stack";
import NotificationsScreen from "../SCREENS/NotificationsScreen";
import MessagesScreen from "../SCREENS/MessagesScreen";
import ProfileScreen from "../SCREENS/ProfileScreen";
import LoginScreen from "../SCREENS/LoginScreen";
import RegisterScreen from "../SCREENS/RegisterScreen";
import SettingsScreen from "../SCREENS/SettingsScreen";
import MainTabNavigator from "../ProfileTabNavigator/MainTabNavigator"; // Ensure this contains your Home tab

const Stack = createStackNavigator();

function MyStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Login" component={LoginScreen} />
      <Stack.Screen name="Register" component={RegisterScreen} />
      {/* Use MainTabNavigator directly here */}
      <Stack.Screen 
        name="Main" 
        component={MainTabNavigator} 
        options={{ headerShown: false }} // Hide header if MainTabNavigator has its own navigation
      />
      {/* Other screens */}
      <Stack.Screen name="Notifications" component={NotificationsScreen} />
      <Stack.Screen name="Messages" component={MessagesScreen} />
      <Stack.Screen name="Profile" component={ProfileScreen} />
      <Stack.Screen name="Settings" component={SettingsScreen} />
    </Stack.Navigator>
  );
}

export default MyStack;
